import React from "react";
import logo from "../assets/logo.png";
const Navbar = () => {
  return (
    <nav>
      <div className="logo">
        <img src={logo} alt="Logo" />
      </div>
      <ul className="navlinks">
        <div className="linkWrapper">
          <li className="link">
            <a href="#">포항연탄은행</a>
          </li>
        </div>
        <li className="link">
          <a href="#">후원안내</a>
        </li>
        <li className="link">
          <a href="#">자원봉사</a>
        </li>
        <li className="link">
          <a href="#">이야기나눔</a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
